#include <iostream>
#include <cmath>




float task1(float c) {
    return powf(c, 3) / cosf(c);
}

float task2(float a, float b) {
    return powf(a, 2) + powf(b, 2);
}


float task3(float x, float b, float e) {
    return sqrtf(fabsf(x)) + powf(e, sqrtf(b));
}

int main() {
    float a, b, c, x;

    std::cout << "Enter a number a:";
    std::cin >> a;

    std::cout << "Enter a number b:";
    std::cin >> b;

    std::cout << "Enter a number c:";
    std::cin >> c;

    std::cout << "Enter a number x:";
    std::cin >> x;

    std::cout << "Result of task1: " << task1(c) << std::endl;
    std::cout << "Result of task2: " << task2(a, b) << std::endl;
    std::cout << "Result of task3: " << task3(x, b, expf(1.0f)) << std::endl;
    
}

