bool Field :: check_field_size(int size) {
    return size <= 4;
}

bool Field :: check_point(Point point) {
    return(point.x >= 0 && point.x < column_size && point.y >= 0 && point.y < row_size);
}

void Field :: create_field(int r_size, int c_size) {
    field_arr = new Cell* [r_size];
    for(int i = 0; i < r_size; i++) {
        field_arr[i] = new Cell[c_size];
    }
}

void Field :: clear_field() {
    if(field_arr == nullptr) return;

    for(int i = 0; i < row_size; i++) {
        delete[] field_arr[i];
    }
    delete[] field_arr;
    field_arr = nullptr;
}

Field :: Field(int row_size, int column_size, Point entry, Point exit) {
    if(!check_field_size(row_size)) row_size = 5;
    if(!check_field_size(column_size)) column_size = 5;
    this->row_size = row_size, this->column_size = column_size;
    if(!check_point(entry)) this->entry = {0,0};
    if(!check_point(exit)) this->exit = {column_size - 1, row_size - 1};
    create_field(row_size, column_size);
}

Field :: Field(int row_size, int column_size) {
    if(!check_field_size(row_size)) row_size = 5;
    if(!check_field_size(column_size)) column_size = 5;
    Field(row_size, column_size, {0,0}, {column_size - 1, row_size - 1});
}

Field :: Field() {
    Field(5, 5, {0,0}, {4,4});
}

Field :: ~Field() {
    std::cout << "Destructor" << std::endl;
    clear_field();
}

Cell Field :: get_cell(int x, int y) {
    if(check_point({x,y})) return field_arr[y][x];
    else {
        std::cout << "Были переданы неправильные координаты. Возвращена клетка {0, 0}\n";
        return field_arr[0][0];
    }
}

Field :: Field(const Field& field) {
    row_size = field.row_size, column_size = field.column_size;
    entry = field.entry, exit = field.exit;
    create_field(row_size, column_size);
    std::copy(&field.field_arr[0][0], &field.field_arr[row_size-1][column_size-1], &this->field_arr[0][0]);
}

Field& Field :: operator= (const Field& field) {
    Field tmp(field);
    std::swap(field_arr, tmp.field_arr);
    std::swap(row_size, tmp.row_size);
    std::swap(column_size, tmp.column_size);
    std::swap(entry, tmp.entry);
    std::swap(exit, tmp.exit);
    return *this;
}

void Field :: print_arr() {
    std::cout << "row = " << row_size << " column = " << column_size << std::endl;
    for(int i = 0; i < row_size; i++) {
        for(int j = 0; j < column_size; j++) {
            std::cout << field_arr[i][j].get_pass() << " ";
