void inserare(int& n) { // n = 7255
    int numarNou = 0;

    while (n > 0) {
		int cifra = n % 10; // 5
        n = n / 10; // 725

        if (cifra % 2 != 0) { // numar impar
			numarNou = numarNou * 10 + (cifra - 1);
		} 
        else { // numar par
        	numarNou = numarNou * 10 + cifra;
        }
	}

    // invert numarNou
    int numarInversat = 0;
    while (numarNou > 0) {
		int cifra = numarNou % 10;
		numarNou = numarNou / 10;
		numarInversat = numarInversat * 10 + cifra;
	}

	n = numarInversat;
}

