using namespace std;

void inserare(int& n) { // n = 7255
    int numarNou = 0;
    int putere = 1; // variabila pentru a urmari pozitia curenta in noul numar

    int cifraPrecedenta = n % 10; // 5
    n /= 10; // 725

    while (n > 0) {
        int cifraCurenta = n % 10; // 5
        int diferenta = abs(cifraCurenta - cifraPrecedenta); // 0

        // construim noul numar adaugand cifra curenta, diferenta, si cifra precedenta
        numarNou += cifraPrecedenta * putere;
        putere *= 10;
        numarNou += diferenta * putere;
        putere *= 10;

        cifraPrecedenta = cifraCurenta;
        n /= 10;
    }
    numarNou += cifraPrecedenta * putere; // adaugam ultima cifra

    n = numarNou; // actualizam n cu valoarea noului numar
}

int main() {
    int n = 7255;
    inserare(n);
    cout << "Numarul obtinut este: " << n << endl;
    return 0;
}

/*Create of 2d array and a person start from position 0,0 and makes it to 3,3 to finish the game.
Program takes 3 user inputs for any 3 positions in the 2d array except 0,0 and 3,3 and if the robot lands
on those positions the loop ends.
user can input w a s d for position change of the robot to lead through the 2d array to reach to 3,3
The game field will be printed on screen for every input of postion change*/

#include <stdio.h>
void mineinput(int *a1, int *a2, int *a3, int *b1, int *b2, int *b3);
void arrayprint(char a[4][4]);
void poschange(int x, int y, int *x_, int *y_);
int fieldcheck(int a_, int b_);
void eventcheck(int a, int b, int a1, int b1, int a2, int b2, int a3, int b3, int *fl);

int main() {
    //Declaring necessary variables
    int i,j,x=0,y=0,x1,y1,x2,y2,x3,y3,x_=0,y_=0,flag;
    //Creating Array
    char gamefield[4][4];
    for (i=0;i<=3;i++){
        for (j=0;j<=3;j++)
            gamefield[i][j]=' ';
    }
    //Scanning and inputing landmines into array, will loop correct input is given
    mineinput(&x1,&y1,&x2,&y2,&x3,&y3);
    while (x1>3||x2>3||x3>3||y1>3||y2>3||y3>3||x1<0||x2<0||x3<0||y1<0||y2<0||y3<0){
        printf ("\nInvalid Input. Please input land mines in (0 <= x,y <= 3)\n");
        mineinput(&x1,&y1,&x2,&y2,&x3,&y3);
    }
    //Shows the position of Landmines on the gamefield. Comment out this part to get invisible land mines
    gamefield[x1][y1]='X';
    gamefield[x2][y2]='X';
    gamefield[x3][y3]='X';
    //Shows the position of Robot (initial position) and Winning position on the gamefield
    gamefield[0][0]='R';
    gamefield[3][3]='W';
    //Loops through printing gamefield, changing position of robot, checking if it's on grid, on W or X
    while(flag==0){
        arrayprint(gamefield);
        poschange(x,y,&x_,&y_);
        if (fieldcheck(x_,y_)==1){
            eventcheck(x_,y_,x1,y1,x2,y2,x3,y3,&flag);
            if (flag == 1){
                gamefield[x][y] = ' ';
                x = x_;
                y = y_;
                gamefield[x][y] = 'R';
                arrayprint(gamefield);
                printf("= = = = = = = = = = = = = = = = = =\n");
                printf("   WINNER WINNER CHICKEN DINNER  \n");
                printf("= = = = = = = = = = = = = = = = = =\n ");
            }
            else if (flag == -1){
                printf("= = = = = = = = =\n");
                printf("    GAME OVER  \n");
                printf("= = = = = = = = =\n ");
            }
            else{
                gamefield[x][y] = ' ';
                x = x_;
                y = y_;
                gamefield[x][y] = 'R';
            }
        }
        else
            flag = 0;
            x_ = x;
            y_ = y;
    }
    return 0;
}
