//Takes user input for movement and assigns a new position for the robot
void poschange(int x, int y, int *x_, int *y_){
    char c;
    printf("Input movement of Robot [W,A,S,D]:\n=> ");
    scanf(" %c",&c);
    switch(c){
        case 'W':
        case 'w':
            *x_ = --x;
            break;
        case 'S':
        case 's':
            *x_ = ++x;
            break;
        case 'A':
        case 'a':
            *y_ = --y;
            break;
        case 'D':
        case 'd':
            *y_ = ++y;
            break;
        default:
            printf("\nInvalid Input of Movement. Please use [W, A, S, D].\n");
            break;
    }
}
//Checks if the robot is on the field or outside it.
int fieldcheck(int a_, int b_){
    if (a_>=0&&a_<=3&&b_>=0&&b_<=3)
        return 1;
    else{
        printf("\nInvalid Input. Robot will move out of game field.\n\n");
        return 0;
    }
}
//Checks if the robot landed on the mines or end point
void eventcheck(int a, int b, int a1, int b1, int a2, int b2, int a3, int b3, int *fl){
    if (a==a1&&b==b1)
        *fl = -1;
    else if (a==a2&&b==b2)
        *fl = -1;
    else if (a==a3&&b==b3)
        *fl = -1;
    else if (a==3&b==3)
        *fl = 1;
    else
        *fl = 0;
}

